import React from 'react';

import './slider.css';


const Slider = () =>{
    let sliderArr=[1,2,3,4,5]
    return(
        <div className="slider">
            {
                sliderArr.map((item,index) =>{
                    return(
                        <div key={index} className="slide">
                            {item}
                        </div>
                    )
                })
            }
            <button className="btn-styles" id="goLeft">left</button>
            <button className="btn-styles" id="goRight">right</button>
        </div>
    )
};

export default Slider;
